using SocketServer.Action;
using System.Diagnostics;
using System.Text.Encodings.Web;
using System.Text.Json;
using System.Text;
using SocketServer.Models;
using Google.Protobuf;
using Bogus;
using System;

namespace SocketServer.Test
{
    [TestClass]
    public class LongStringTransportSpendTime_th_Test
    {
        private static int loopTimes { get; set; } = 10000;
        private static int textLength { get; set; } = 65535; // base on 1024 * 64 >> setting memory size,and need reduce property action length
        private static ActionRegister.Response resultForJson { get; set; } = new ActionRegister.Response() { action = "register" };
        private static Register.Response resultForProtobuf { get; set; } = new Register.Response() { Action = "register" };
        private Stopwatch stopWatch { get; set; } = new Stopwatch();

        [ClassInitialize()]
        public static void Init(TestContext context)
        {
            string target = ReturnThaiLongString();

            string idString = target.Substring(0,textLength);
            resultForJson.id = idString;
            resultForProtobuf.Id = idString;
        }

        [TestMethod]
        public void SerilizeJsonAndConvertToByteArray_SpandTime()
        {
            Console.WriteLine($"data length: {resultForJson.id.Length}");

            stopWatch.Start();

            // Execute
            for (int i = 0; i < loopTimes; i++)
            {
                var str = JsonSerializer.Serialize(resultForJson, new JsonSerializerOptions
                {
                    Encoder = JavaScriptEncoder.UnsafeRelaxedJsonEscaping,
                    WriteIndented = true
                });

                var buff = Encoding.UTF8.GetBytes(str);
                var data = new ArraySegment<byte>(buff, 0, buff.Length);
            }

            stopWatch.Stop();

            Console.WriteLine($"spend time: {stopWatch.ElapsedMilliseconds}");
        }


        [TestMethod]
        public void SerilizeJsonAndConvertToByteArray_Count()
        {
            var str = JsonSerializer.Serialize(resultForJson, new JsonSerializerOptions
            {
                Encoder = JavaScriptEncoder.UnsafeRelaxedJsonEscaping,
                WriteIndented = true
            });

            var buff = Encoding.UTF8.GetBytes(str);
            var data = new ArraySegment<byte>(buff, 0, buff.Length);

            Console.WriteLine($"Count: {data.Count}");
        }

        [TestMethod]
        public void SerilizeJsonAndCompressAndConvertToByteArray_SpandTime()
        {
            Console.WriteLine($"data length: {resultForJson.id.Length}");

            stopWatch.Start();

            // Execute
            for (int i = 0; i < loopTimes; i++)
            {
                var str = JsonSerializer.Serialize(resultForJson, new JsonSerializerOptions
                {
                    Encoder = JavaScriptEncoder.UnsafeRelaxedJsonEscaping,
                    WriteIndented = true
                });

                var buff = Encoding.UTF8.GetBytes(str);
                var compressedBuff = CompressTool.MicrosoftCompress(buff);
                var data = new ArraySegment<byte>(compressedBuff, 0, compressedBuff.Length);
            }

            stopWatch.Stop();

            Console.WriteLine($"spend time: {stopWatch.ElapsedMilliseconds}");
        }

        [TestMethod]
        public void SerilizeJsonAndCompressAndConvertToByteArray_Count()
        {
            var str = JsonSerializer.Serialize(resultForJson, new JsonSerializerOptions
            {
                Encoder = JavaScriptEncoder.UnsafeRelaxedJsonEscaping,
                WriteIndented = true
            });

            var buff = Encoding.UTF8.GetBytes(str);
            var compressedBuff = CompressTool.MicrosoftCompress(buff);
            var data = new ArraySegment<byte>(compressedBuff, 0, compressedBuff.Length);

            Console.WriteLine($"Count: {data.Count}");
        }

        [TestMethod]
        public void SerilizeProtobufAndByteArray_SpandTime()
        {
            Console.WriteLine($"data length: {resultForProtobuf.Id.Length}");

            stopWatch.Start();

            // Execute
            for (int i = 0; i < loopTimes; i++)
            {
                using (var ms = new MemoryStream())
                {
                    resultForProtobuf.WriteTo(ms);
                    var buff = ms.ToArray();
                    var data = new ArraySegment<byte>(buff, 0, buff.Length);
                }
            }

            stopWatch.Stop();

            Console.WriteLine($"spend time: {stopWatch.ElapsedMilliseconds}");
        }

        [TestMethod]
        public void SerilizeProtobufAndByteArray_Count()
        {
            using (var ms = new MemoryStream())
            {
                resultForProtobuf.WriteTo(ms);
                var buff = ms.ToArray();
                var data = new ArraySegment<byte>(buff, 0, buff.Length);

                Console.WriteLine($"Count: {data.Count}");
            }
        }

        private static string ReturnThaiLongString()
        {
            // https://lorem.in.th/
            //generate string length 60000+ 
            return "แอบมองไปกับตัวของเมื่อวานสู่ดินแดนแสนวิเศษแม้จะเดินผ่านแต่ไม่เหลือเลยไม่คิดเลยไม่ต้องสั่นไหวในใจไว้ที่มีเพียงสองเราจะเป็นคนอย่างนี้บอกตัวเธอรู้ฉันก็วิวดีที่เราที่มีในใจเธอนั้นมีอยู่ตรงหน้าเธอนั้นได้ไหมคะกอดเธอจะร้องให้รู้ปล่อยใจลอยล่องในใจแล้วสิเออยินดีจะพาให้เธอก็มีสุขมีเหงากันไปด้วยกันตรงนี้เธอมีเธอจะไม่เคยบอกตัวเองต้องฝันสักวันที่อ่อนล้าเหมือนฟ้าที่มืดมนมีแค่เพียงได้ไหมสักคนที่หัวใจเต็มล้นและมันไว้ทำไมอยากจะได้พบเธอไปด้วยกันนะเราที่ได้อยู่ในที่มีให้เรากำลังตามหาความฝันใช่ไหมให้รู้ว่าชอบไปทุกทุกวันที่ไม่เหลือเลยไปไกลแค่เพียงบางๆผ้าอังกอร์จากใครที่มีแค่เราจะรอพวกเธอรู้ว่าชอบฟังเสียงนกร้องอย่างนั้นมีความรู้สึกเราอยู่ตรงนี้ท่ามกลางผู้คนมากมายมาตั้งแต่วันนี้ไม่เคยจางฉันเฝ้ามองไปเพื่อให้เธอรู้ชัดชัดได้ไหมแต่เหมือนใครจะสมดังปรารถนาฟังแล้วสิเราจะสักวันไปสิเออแม้ทุกทุกวันนัดเดทแต่ยังไม่สายจะอยู่อย่างนี้ต้องไปให้เธอมีความเสียใจมาเต้นเต้นกันใหม่ได้พบเธอต้องไปเลยไม่เห็นจะหายไปจะไม่ว่าใครจะคอยรับช่วงเดินต่อไม่เคยเลือนลางหน้ากากใหม่ๆก็เหมือนโดนอย่างชัดเจนขึ้นมาไม่ต้องไปเลยไม่เหลือเลยไม่ให้คนสำคัญกว่าใครไปให้เธอจากนี้ก็เท่านั้นเพียงน้ำตาเอ่อล้นลึกๆหมุนไปให้ใจเอาล่ะเตรียมใจไว้เถอะพักตรงนี้จะเลือนลางให้ชื่นใจนั้นเป็นเฉยทำไม่ได้รับรู้ไม่เอาไว้ที่ฉันยังอยู่ในใจของฉันช่างมันไปด้วยกันมองไปด้วยกันสิคะศรัทธาซ่อนสดสวยด้วยกันและพ้นเรื่องเลวร้ายนั้นก็คงห้ามหมดไฟบนนั้นขอให้เธอจะเป็นเรื่องร้ายๆกังวลปล่อยใจลอยล่องในอากาศมาเลยไม่เคยจะสนใจมหาสารคามต้องยอมทำได้ไงก็ต้องเสี่ยงกันฉันไม่สายแน่เลยก็ดีถ้ามีรางวัลสักเท่าไหร่คงจะยังนึกเรื่องนี้มาเต้นกันให้มันส์อื่นวิ่งตามฝันนั้นเป็นจริงในสักเท่าไรถ้าไม่ต้องให้เธอเท่านั้นเพียงหนึ่งคนดีไหมเธอต้องปล่อยมันฉันจะไปเลยไม่เคยจะไม่เคยจางจะข้ามบันไดและน่ารักจะไม่ว่าสุดท้ายลงเอยเช่นไรถึงวันและมีฝั่งข้างหน้าอีกไม่ต้องไปร้อยเอ็ดพูดความจริงจากใครกำลังเรียกฉันจะไปซีเรียสนักรุมมันคงอยู่ไม่รู้ว่าฉันเผลอเฝ้ามองมันไม่สู้ปานวดตัวเองแอบมองตาเธออยู่ตรงนี้ด้วยกันสักเท่าไรไปเลยไม่สนไม่ว่ายังไงใจอยู่ในใจนั้นก็คงต้องพอและไม่ใจร้ายนะฉันจะฝ่ามันเป็นเหมือนว่าจะเป็นยังไงเอื้อมไม่เคยความรู้สึกฉันถ้าไม่ต้องลังเลแค่ไหนที่งดงามไม่เป็นไรถ้าเธอพวกเราพร้อมร่วมทางไม่เคย